void tree(int n)
{
	int id, i, j, w, u, v;

	for (i = 0; i < n; i++) par[i] = m[i] = i, semi[i] = -1;

	id = 0, q[0] = 0, top = 1;
	while (top) {
		v = q[--top];
		if (semi[v] >= 0) continue;
		semi[v] = id;
		vertex[id++] = v;
		for (i = g_hi[v]-1; i >= 0; i--) {
			u = g_to[v][i];
			if (semi[u] < 0) parent[u] = v, q[top++] = u;
		}
	}
	free(q);

	b_to = malloc(n * sizeof(int *));
	b_to[0] = malloc(25000 << 2);
	for (i = 1; i < n; i++) b_to[i] = malloc(MAGIC << 2);

	b_to[0][0] = 0, u = 25000;
	for (i = 1; i < n; i++) for (j = 0; j < MAGIC; j++) {
		b_to[i][j] = u, u += MAGIC;
	}

	for (i = n-1; i > 0; i--) {
		w = vertex[i];
		for (j = 0; j < r_hi[w]; j++) {
			v = r_to[w][j];
			u = eval(v);
			if (semi[w] > semi[u]) semi[w] = semi[u];
		}
		v = vertex[semi[w]];
		b_to[v][b_hi[v]++] = w;
		u = parent[w];
		for (j = 0; j < b_hi[u]; j++) {
			v = b_to[u][j];
			U[v] = eval(v);
		}
		b_hi[u] = 0;
		link(u, w);
	}
//	free(b_to);

	for (i = 1; i < n; i++) {
		w = vertex[i];
		u = U[w];
		if (semi[w] == semi[u]) idom[w] = semi[w];
		else idom[w] = idom[u];
	}
	for (i = 1; i < n; i++) {
		w = vertex[i];
		idom[w] = vertex[idom[w]];
	}
}
